import React from "react";
import '../../styles/home.css';



export class Home extends React.Component{
    render(){
        return(
            <div>
                <div className="row hidden">
                    <div className="col-12">
                        <h1>Hiding Under the NAV BAR</h1>
                    </div>
                </div> 
                <div class="jumbotron">
                    <h1 class="display-4">Hello, world!</h1>
                    <p class="lead">This is a simple hero unit, a simple jumbotron-style component for calling extra attention to featured content or information.</p>
                    <hr class="my-4"/>
                    <p>It uses utility classes for typography and spacing to space content out within the larger container.</p>
                    <a class="btn btn-primary btn-lg" href="#" role="button">Learn more</a>
                </div>
                <main role="main" className="pic2">
                    <div className="container mb-3">
                        <div className="row pt-5 intro">
                            <p>Welcome to BitCoinage Check! This website is for educational purposes only. It is intended on prodviding information. We are not an exchange or sell any coins or tokens of any kind. The website is intended to make it easy to check pricing across multiple global exchanges and currencies. Please feel feel to donate to BitCoin Wallet address: <strong>1J4rLxX2N3EgieuwCfw15HDoM95gdg33o4</strong></p>
                        </div>
                    </div>
                </main>
            </div>
        );
    }
}

export default Home;
